    false,nt"url": null,nt"notes": "This document provides the Data Acquisition
    Plan for the South Bay Salt Pond Restoration Project. The purpose of the Data Acquisition
    Plan is to guide the collection of information pertinent to restoration planning.
    The Data Acquisition Plan identifies topics of data collection, identifies data
    sources, and specifies data collection processes and protocols. The Data Acquisition
    Plan is the first step in the Information Gathering Task.  In the Information Gathering
    Task, existing information pertinent to the restoration planning will be compiled
    and evaluated. The work products of the Information Gathering Task will be a bibliography
    of published and unpublished literature/reports/data, a GIS database of existing
    spatial data, and a Data Summary Report. The Data Summary Report will summarize
    the pertinent information found, identify critical data gaps, and present recommendations
    for filling those gaps. The results of the Information Gathering Task will help
    provide a sound scientific basis for the restoration planning.",nt"license_title":
